import { Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Contact from './pages/Contact';
import About from './pages/About';


function App() {
  return (
    <div>
      <Navbar />
      <Switch>

      <Route path="/">
        <Home/>
      </Route>

      <Route>
        <Contact path="/contact"/>
      </Route>

      <Route  path="/cbout">
        <About/>
      </Route>
      </Switch>

    </div>
  );
}

export default App;
